import React from "react";
import Navbar from "./components/Navbar";
import "./App.css";
import Home from "./components/pages/Home";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Login from "./components/pages/Login";
import SignUp from "./components/pages/SignUp";
import StudentSignup from "./components/pages/StudentSignUp";
import AdvisorSignup from "./components/pages/AdvisorSignUp";

function App() {
  return (
    <>
      <Router>
        <Navbar />
        <Routes>
          {/* Landing Page: Login or SignUp */}
          <Route path="/" element={<LoginSignUp />} />

          {/* Home Page */}
          <Route path="/home" element={<Home />} />

          {/* Signup Routes */}
          <Route path="/signup" element={<SignUp />} />
          <Route path="/signup/student" element={<StudentSignup />} />
          <Route path="/signup/advisor" element={<AdvisorSignup />} />

          {/* Login Route */}
          <Route path="/login" element={<Login />} />
        </Routes>
      </Router>
    </>
  );
}

// Login or SignUp Component
function LoginSignUp() {
  // You can implement the logic for displaying a choice between login and signup here
  // Once the user makes a choice, you can redirect them to the corresponding route
  return (
    <div>
      <h2>Welcome! Choose Login or SignUp</h2>
      {/* Implement your choice and redirection logic here */}
    </div>
  );
}

export default App;
